css:
atom-text-editor,
:host {
  background-color: #263238;
  color: #cfd8dc;
}
atom-text-editor .wrap-guide,
:host .wrap-guide {
  background-color: #2e3d44;
}
atom-text-editor .indent-guide,
:host .indent-guide {
  color: #304047;
}
atom-text-editor .invisible-character,
:host .invisible-character {
  color: #455a64;
}
atom-text-editor .gutter,
:host .gutter {
  background-color: #222d32;
  color: #90a4ae;
}
atom-text-editor .gutter .line-number.cursor-line,
:host .gutter .line-number.cursor-line {
  background-color: #2c3a41;
  color: #cfd8dc;
}
atom-text-editor .gutter .line-number.cursor-line-no-selection,
:host .gutter .line-number.cursor-line-no-selection {
  color: #cfd8dc;
}
atom-text-editor .gutter .line-number.folded,
:host .gutter .line-number.folded,
atom-text-editor .gutter .line-number:after,
:host .gutter .line-number:after,
atom-text-editor .fold-marker:after,
:host .fold-marker:after {
  color: #90a4ae;
}
atom-text-editor .invisible,
:host .invisible {
  color: #cfd8dc;
}
atom-text-editor .cursor,
:host .cursor {
  color: #90a4ae;
}
atom-text-editor .selection .region,
:host .selection .region {
  background-color: #000000;
}
atom-text-editor .search-results .marker .region,
:host .search-results .marker .region {
  background-color: transparent;
  border: 1px solid #90a4ae;
}
atom-text-editor .search-results .marker.current-result .region,
:host .search-results .marker.current-result .region {
  border: 1px solid #ffffff;
}
.comment {
  color: #607d8b;
  font-style: italic;
}
.entity.name.type {
  color: #ffb74d;
}
.entity.other.inherited-class {
  color: #ffb74d;
}
.keyword {
  color: #ce93d8;
}
.keyword.control {
  color: #ce93d8;
}
.keyword.operator {
  color: #607d8b;
}
.keyword.operator.new {
  color: #ce93d8;
}
.keyword.other.special-method {
  color: #00b0ff;
}
.keyword.other.unit {
  color: #ff9800;
}
.storage {
  color: #ce93d8;
}
.storage.type.function {
  font-style: italic;
}
.storage.type.class.todo {
  color: #90a4ae;
  font-weight: bold;
}
.constant {
  color: #ff9800;
}
.constant.character.escape {
  color: #4dd0e1;
}
.constant.numeric {
  color: #ff9800;
}
.constant.other.color {
  color: #4dd0e1;
}
.constant.other.symbol {
  color: #aed581;
}
.variable {
  color: #e57373;
}
.variable.interpolation {
  color: #dd4848;
}
.variable.parameter.function {
  color: #cfd8dc;
}
.invalid.illegal {
  background-color: #e57373;
  color: #263238;
}
.string {
  color: #aed581;
}
.string.regexp {
  color: #4dd0e1;
}
.string.regexp .source.ruby.embedded {
  color: #ff9800;
}
.string.other.link {
  color: #e57373;
}
.punctuation {
  color: #607d8b;
}
.punctuation.definition.comment {
  color: #607d8b;
}
.punctuation.definition.string,
.punctuation.definition.variable,
.punctuation.definition.parameters,
.punctuation.definition.array,
.punctuation.definition.tag {
  color: #607d8b;
}
.punctuation.definition.heading,
.punctuation.definition.identity {
  color: #00b0ff;
}
.punctuation.definition.bold {
  color: #ffb74d;
  font-weight: bold;
}
.punctuation.definition.italic {
  color: #ce93d8;
  font-style: italic;
}
.punctuation.section.embedded {
  color: #dd4848;
}
.support.class {
  color: #ff9800;
}
.support.function {
  color: #cfd8dc;
}
.support.function.any-method {
  color: #00b0ff;
}
.support.constant.dom {
  color: #cfd8dc;
}
.entity.name.function {
  color: #00b0ff;
}
.entity.name.class,
.entity.name.type.class {
  color: #ffb74d;
}
.entity.name.section {
  color: #00b0ff;
}
.entity.name.tag {
  color: #e57373;
}
.entity.other.attribute-name {
  color: #ff9800;
}
.meta {
  color: #607d8b;
}
.meta.class {
  color: #ffb74d;
}
.meta.link {
  color: #ff9800;
}
.meta.require {
  color: #00b0ff;
}
.meta.selector {
  color: #ce93d8;
}
.meta.separator {
  background-color: #607d8b;
  color: #cfd8dc;
}
.meta.toc-list.id {
  color: #aed581;
}
.none {
  color: #cfd8dc;
}
.markup.bold {
  color: #ff9800;
  font-weight: bold;
}
.markup.changed {
  color: #ce93d8;
}
.markup.deleted {
  color: #e57373;
}
.markup.italic {
  color: #ce93d8;
  font-style: italic;
}
.markup.heading .punctuation.definition.heading {
  color: #00b0ff;
}
.markup.inserted {
  color: #aed581;
}
.markup.list {
  color: #e57373;
}
.markup.quote {
  color: #ff9800;
}
.markup.raw.inline {
  color: #aed581;
}
.source.php .meta.function-call.php,
.source.php .meta.function-call.object.php,
.source.php .meta.function-call.static.php {
  color: #00b0ff;
}
.source.php .meta.string-contents.quoted.php {
  color: #aed581;
}
.source.php .support.other.namespace.use.php {
  color: #cfd8dc;
}
.source.php .support.other.namespace.use-as.php {
  color: #ffb74d;
}
.source.php .variable.other.php {
  color: #cfd8dc;
}
.source.php .variable.other.property.php {
  color: #e57373;
}
.source.php .keyword.other.phpdoc.php {
  color: #e57373;
}
.source.php .constant.other.class.php {
  color: #4dd0e1;
}
.source.php .storage.type.php {
  color: #ffb74d;
}
.source.php .storage.type.class.php,
.source.php .storage.type.function.php {
  color: #ce93d8;
}
.source.gfm .markup {
  -webkit-font-smoothing: auto;
}
.source.gfm .markup.heading {
  color: #aed581;
}
atom-text-editor[mini] .scroll-view,
:host([mini]) .scroll-view {
  padding-left: 1px;
}
